  backdrop: {
      position: 'fixed',
      top: 0,
      right: 0,

  },
  container: {},
});

const SearchModal: React.FC<IProps> = () => {
  const classes = useStyles();

  return (
    <>
      <div className={classes.backdrop}></div>
      <div className={classes.container}></div>
    </>
  );
};

export default SearchModal;
